import './Navbar.css';
function Navbar(){
    return(
        <div className="container">
    <header className="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3 mb-4 border-bottom">
      <div classNameName="col-md-3 mb-2 mb-md-0">
        <a href="/" classNameName="d-inline-flex link-body-emphasis text-decoration-none">
          {/* <svg className="bi" width="40" height="32" role="img" aria-label="Bootstrap"><use xlink:href="#bootstrap"></use></svg> */}
        </a>
      </div>

      <ul className="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
        <li><a href="#" className="nav-link px-2 link-secondary">Home</a></li>
        <li><a href="#" className="nav-link px-2 link-dark">Shop</a></li>
        <li><a href="#" className="nav-link px-2 link-dark">Collections</a></li>
        <li><a href="#" className="nav-link px-2 link-dark">About</a></li>
        <li><a href="#" className="nav-link px-2 link-dark">Contact Us</a></li>
      </ul>

      <div className="col-md-3 text-end">
        <button type="button" className="btn btn-outline-warning me-2">Login</button>
        <button type="button" className="btn btn-dark signup">Sign-up</button>
      </div>
    </header>
  </div>
    );
    
}
export default Navbar;
